import React, { useState, useEffect, useRef } from "react";
import { Link } from "react-router-dom";
import "./navbar.css";
import "./navbar_responsive.css";

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const navbarRef = useRef(null);
  const menuRef = useRef(null);
  
  // Enhanced click outside detection
  useEffect(() => {
    const handleClickOutside = (event) => {
      // Check if click is outside both the menu and the hamburger button
      if (
        menuRef.current && 
        !menuRef.current.contains(event.target) &&
        !event.target.closest('.hamburger')
      ) {
        setIsMenuOpen(false);
      }
    };

    // Only add listener if menu is open
    if (isMenuOpen) {
      document.addEventListener("mousedown", handleClickOutside);
    }

    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, [isMenuOpen]); // Dependency on isMenuOpen ensures proper cleanup

  // Handle menu toggle
  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  // Handle link clicks
  const handleLinkClick = () => {
    setIsMenuOpen(false);
  };

  return (
    <nav className="navbar" ref={navbarRef}>
      <div className="nav-container">
        <button
          className={`hamburger ${isMenuOpen ? "active" : ""}`}
          onClick={toggleMenu}
          aria-label="Toggle navigation"
          aria-expanded={isMenuOpen}
        >
          &#9776;
        </button>

        <div className="logo">
          <Link to="/">
            StayHealth
            <span className="inc">Inc</span>
            <span className="doctor-icon">
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1000 1000">
                <title>Doctor With Stethoscope SVG icon</title>
                <g>
                  <path d="M499.8,10c91.7,0,166,74.3,166,166c0,91.7-74.3,166-166,166c-91.7,0-166-74.3-166-166C333.8,84.3,408.1,10,499.8,10z"></path>
                  <path d="M499.8,522.8c71.2,0,129.1-58.7,129.1-129.1H370.6C370.6,464.1,428.6,522.8,499.8,522.8z"></path>
                  <path d="M693.2,395c-0.7,94.9-70.3,173.7-160.8,188.9v155.9c0,80.3-60.7,150.8-140.8,155.3c-83,4.7-152.7-58.9-157.6-139.7c-22-12.8-35.6-38.5-30.3-66.7c4.7-25.1,25.5-45.6,50.8-49.9c39.7-6.7,74.1,23.7,74.1,62.1c0,23-12.3,43-30.7,54.1c4.7,45.4,45.1,80.4,92.6,76c44.6-4,77.2-44...."></path>
                </g>
              </svg>
            </span>
          </Link>
        </div>

        <ul 
          className={`nav-links ${isMenuOpen ? "active" : ""}`}
          ref={menuRef}
          role="menu"
        >
          <li><Link to="/services" onClick={handleLinkClick}>Services</Link></li>
          <li><Link to="/appointments" onClick={handleLinkClick}>Appointments</Link></li>
          <li><Link to="/blog" onClick={handleLinkClick}>Blog</Link></li>
          <li><Link to="/review" onClick={handleLinkClick}>Review</Link></li>
          <li><Link to="/about" onClick={handleLinkClick}>About Us</Link></li>
        </ul>

        <div className="nav-buttons">
          <Link to="/login" className="login-btn">Login</Link>
          <Link to="/signup" className="signup-btn">Sign up</Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
